import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './components/Navigation';d

import Home from './pages/Home'

const VariablesDataTypes = () => <h1>Переменные и типы данных</h1>;
const OperatorsExpressions = () => <h1>Операторы и выражения</h1>;
const ConditionalExpressions = () => <h1>Условные выражения</h1>;
const Cycles = () => <h1>Циклы</h1>;
const Functions = () => <h1>Функции</h1>;
const Strings = () => <h1>Строки</h1>
const ListsAndTuples = () => <h1>Списки и кортежи</h1>
const DictsAndSets = () => <h1>Словари и множества</h1>
const Libraries = () => <h1>Библиотеки</h1>
const ClassesAndObjects = () => <h1>Классы и объекты</h1>
const AdvancedOOP = () => <h1>Продвинутое ООП</h1>


const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Home />} />

        <Route path="/python-basics/variables-and-data-types" element={<VariablesDataTypes />} />
        <Route path="/python-basics/operators-and-expressions" element={<OperatorsExpressions />} />

        <Route path="/conditional-and-cycles/conditional-expressions" element={<ConditionalExpressions />} />
        <Route path="/conditional-and-cycles/cycles" element={<Cycles />} />

        <Route path="/functions" element={<Functions />} />

        <Route path="/dataTypes/strings" element={<Strings />} />
        <Route path="/dataTypes/lists-and-tuples" element={<ListsAndTuples />} />
        <Route path="/dataTypes/dicts-and-sets" element={<DictsAndSets />} />

        <Route path="/libraries" element={<Libraries />} />

        <Route path="/oop/classes-and-objects" element={<ClassesAndObjects />} />
        <Route path="/oop/advanced-OOP" element={<AdvancedOOP />} />
      </Routes>
    </Router>
  );
};

export default App;
